INSERT INTO `knjiga` (`id`, `naslov`, `autor`, `opis`, `slika`, `stanje`) VALUES
(7, 'Party Monster: A Fabulous But True Tale of Murder in Clubland', 'James St. James', 'When Party Monster was first published, it created a storm of controversy for its startlingly vivid, strikingly fresh, and outrageous depiction of the hedonistic world of the 90s New York City club kids, for whom nothing was too outré—including murder. Nominated for the Edgar Award for best true crime book of the year, it also marked the debut of an audaciously talented writer, James St. James, who himself had been a club kid and close friend and confidant of Michael Alig, the young man convicted of killing the drug dealer known as Angel. This is the inside story of life in clubs like The Tunnel and The Limelight and hanging with leading lights like Keith Haring and RuPaul and the drugs, sex, music, and mayhem that existed during the heyday of New York City club culture.', , 2);
INSERT INTO `knjiga` (`id`, `naslov`, `autor`, `opis`, `slika`, `stanje`) VALUES
(8, 'How to Read a Book: The Classic Guide to Intelligent Reading', 'Mortimer J. Adler, ‎Charles Van Doren', 'Investigates the art of reading by examining each aspect of reading, problems encountered, and tells how to combat them.', , 3),
(9, 'Going to Buy a Book', 'Rukmini Banerji', 'Children always like to share their experience with others. \'Going to Buy a Book\' shows how enjoyable these experiences can be. Tag along with these siblings as they pick books in a bookstore.', , 4),
(10, 'Fahrenheit 451: A Novel', 'Ray Bradbury ', 'Guy Montag is a fireman, his job is to burn books, which are forbidden.', , 6);
INSERT INTO `knjiga` (`id`, `naslov`, `autor`, `opis`, `slika`, `stanje`) VALUES
(11, 'Divergent (Divergent Trilogy, Book 1)', 'Veronica Roth', 'In the world of Divergent, society is divided into five factions – Candor, Abnegation, Dauntless, Amity and Erudite. Every year, all sixteen-year-olds must select the faction to which they will devote the rest of their lives. For Beatrice Prior, the decision is between staying with her family and being who she really is. Her choice shocks everyone, including herself.\r\n\r\nDuring the initiation that follows, Tris and her fellow initiates undergo extreme physical tests of endurance and intense psychological simulations, with devastating consequences. As initiation transforms them, Tris must determine who her friends really are – and whether she can trust the man who both threatens and protects her.\r\n\r\nBecause Tris has a deadly secret. And as growing conflict threatens to unravel their seemingly perfect society, this secret might save those she loves... or it might destroy her.', , 1);

